  [],\n\t\"num_tags\": 0,\n\t\"name\": \"the-2007-joint-u-s-canada-integrated-acoustic-and-trawl-survey-of-pacific-hake-merluccius-produ\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Scientists from the Fishery Resource Analysis
  and Monitoring (FRAM) division at the NOAA Fisheries Northwest Fisheries Science
  Center (NWFSC) and the Pacific region of the Department of Fisheries and Oceans
  Canada (DFO) conducted the Joint 2007 Integrated Acoustic Survey (IAT) survey aboard
  the NOAA Ship Miller Freeman, a stern trawler equipped for fisheries and oceanographic
  research.  Pacific Hake (Merluccius productus) aggregations were targeted along
  the continental shelf and upper slope of the entire survey area. nnHake populations
  were surveyed along a series of parallel line transects that in general were oriented
  east-west, spaced at an interval of 10 nmi apart, and traversed sequentially in
  alternating directions; The survey began from north of Point Piedras Blancas, CA
  (35.8?N) to the Dixon Entrance area, Canada (54.9?N) between June 20 and Aug. 21.
  All transects up to the Dixon Entrance and along the west coast of Haida Gwaii were
  completed. Sea depth at the inshore end of individual transects was nominally 50
  m. Offshore extent of individual transects was typically at a depth of 1,500 m.\",\n\t\"owner_org\":
